Camp Rock 2: The Final Jam (2010)  

Verenigde Staten
Familie / Muziek
97 minuten

geregisseerd door Paul Hoen
met Demi Lovato, Joe Jonas en Meaghan Jette Martin

Het vervolg op Camp Rock volgt het leven van Mitchie, Shane, Jason, Nate en hun vrienden wanneer ze terug gaan naar Camp Rock voor nog een geweldige zomer met muziek en plezier. Eenmaal aangekomen komen ze er al snel achter dat een nieuw kamp genaamd Camp Star is geopend. Dit nieuwe kamp ligt ook aan het meer en heeft veel instructeurs en bezoekers van Camp Rock meegenomen waardoor de toekomst van Camp Rock in gevaar komt. Wanneer de beste zanger van Camp Star Camp Rock uitdaagt om te zien welk kamp nou werkelijk de beste muzikale talenten heeft, bereidt iedereen zich voor op de ultieme wedstrijd. Alleen is er ÃƒÆ’Ã‚Â©ÃƒÆ’Ã‚Â©n probleem wanneer Nate op de dochter van de concurrent zijn baas valt.

